const{createApp}=Vue,form=createApp({async mounted(){await this.renderData()},methods:{async renderData(){this.message&&(this.message=null);this.inquiries=await $.get("/api/inquiry/getinquiries");this.loading&&setTimeout(()=>this.loading=!1,800)},async resolve(n){const t=await $.get("/api/inquiry/resolve",{id:n});t.success?await this.renderData():this.message=t.errors.serverError},async deleteOne(n){const t=await $.get("/api/inquiry/delete",{id:n});t.success?await this.renderData():this.message=t.errors.serverError}},data(){return{inquiries:[],message:null,loading:!0}}}).mount("#dashboard");